import request from "./utils";

export async function getMenuElements() {
  const requestURL = "http://localhost:1337/api/menus";
  try {
    let result: IResult = await request(requestURL, { method: "GET" });
    return result.data;
  } catch (e) {
    console.error(e);
  }
}
